pragma solidity >=0.5.16 <0.8.0;

contract ManageID {
    address public ContractOwner;

    constructor() public {
        ContractOwner = msg.sender;
    }

    struct User {
        string first_name;
        string last_name;
        string email;
        uint256 phone_no;
        string password;
    }
    struct UserAadhar {
        string aadhar_no;
        string aadhar_name;
        string aadhar_DOB;
        string aadhar_ipfs_hash;
    }
    struct UserDrivingLicense {
        string dl_no;
        string dl_name;
        string dl_DOB;
        string dl_ipfs_hash;
    }
    struct UserPassport {
        string passport_no;
        string passport_name;
        string passport_birth_place;
        string passport_ipfs_hash;
    }

    struct UploadedDocuments {
        bool aadhar;
        bool driving_license;
        bool passport;
    }



    mapping(address => User) public UserMap;
    mapping(address => UserAadhar) public UserAadharMap;
    mapping(address => UserDrivingLicense) public UserDLMap;
    mapping(address => UserPassport) public UserPassportMap;

    mapping(address => UploadedDocuments) public UploadedDocMap;

    function addUser(
        address user_address,
        string memory first_name,
        string memory last_name,
        string memory email,
        uint256 phone_no,
        string memory password
        ) public {
            UserMap[user_address] = User(first_name, last_name, email, phone_no, password);
    }

    function addUserAadhar(
        address user_address,
        string memory aadhar_no,
        string memory aadhar_name,
        string memory aadhar_dob,
        string memory aadhar_ipfs_hash
        ) public {
            UserAadharMap[user_address] = UserAadhar( aadhar_no, aadhar_name, aadhar_dob, aadhar_ipfs_hash);
            UploadedDocMap[user_address].aadhar = true;
    }

    function addUserDrivingLicense(
        address user_address,
        string memory dl_no,
        string memory dl_name,
        string memory dl_dob,
        string memory dl_ipfs_hash
        ) public {
            UserDLMap[user_address] = UserDrivingLicense( dl_no, dl_name, dl_dob, dl_ipfs_hash);
            UploadedDocMap[user_address].driving_license = true;
    }

    function addUserPassport(
        address user_address,
        string memory passport_no,
        string memory passport_name,
        string memory passport_birth_place,
        string memory passport_ipfs_hash
        ) public {
            UserPassportMap[user_address] = UserPassport( passport_no, passport_name, passport_birth_place, passport_ipfs_hash);
            UploadedDocMap[user_address].passport = true;
    }

    function getUploadedDocs(address user_address) public view 
        returns (
            bool aadhar,
            bool driving_license,
            bool passport
            ) {
            UploadedDocuments storage Docs = UploadedDocMap[user_address];
            return ( 
                Docs.aadhar, 
                Docs.driving_license, 
                Docs.passport );
    }

    function getUser(address user_address) public view
        returns (
            string memory first_name,
            string memory last_name,
            string memory email,
            string memory password,
            uint256 phone_no
            ) {
            User storage ThisUser = UserMap[user_address];
            return ( 
                ThisUser.first_name, 
                ThisUser.last_name, 
                ThisUser.email,
                ThisUser.password, 
                ThisUser.phone_no );
    }

    function getUserAadhar(address user_address) public view 
        returns (
            string memory aadhar_no,
            string memory aadhar_name,
            string memory aadhar_DOB,
            string memory aadhar_ipfs_hash
        ) {
            UserAadhar storage Data =UserAadharMap[user_address];

            return (
                Data.aadhar_no,
                Data.aadhar_name,
                Data.aadhar_DOB,
                Data.aadhar_ipfs_hash
            );
    }

    function getUserDrivingLicense(address user_address) public view 
        returns (
            string memory dl_no,
            string memory dl_name,
            string memory dl_DOB,
            string memory dl_ipfs_hash
        ) {
            UserDrivingLicense storage Data =UserDLMap[user_address];

            return (
                Data.dl_no,
                Data.dl_name,
                Data.dl_DOB,
                Data.dl_ipfs_hash
            );
    }

    function getUserPassport(address user_address) public view 
        returns (
            string memory passport_no,
            string memory passport_name,
            string memory passport_birth_place,
            string memory passport_ipfs_hash
        ) {
            UserPassport storage Data =UserPassportMap[user_address];

            return (
                Data.passport_no,
                Data.passport_name,
                Data.passport_birth_place,
                Data.passport_ipfs_hash
            );
    }


    // Organization
    struct Org {
        string name;
        string email;
        string password;
    }

    mapping(address => Org) public OrgMap;

    function addOrg(
        address org_address,
        string memory name,
        string memory email,
        string memory password
        ) public {
            OrgMap[org_address] = Org( name, email, password);
    }

    function getOrg(address org_address) public view
        returns (
            string memory name,
            string memory email,
            string memory password
            ) {
            Org storage ThisOrg = OrgMap[org_address];
            return ( 
                ThisOrg.name,  
                ThisOrg.email,
                ThisOrg.password );
    }

    // Request Documents

    /*
    status 0 : default
    status 1 : requested
    status 2 : approved
    status 3 : decline
    */

    struct RequestDocuments {
        string requestedBy;
        string aadhar;
        string dl;
        string passport;
    }

    mapping(address => RequestDocuments) public RequestDocumentsMap;

    function sendRequest(
        string memory requestedBy,
        string memory aadhar,
        string memory dl,
        string memory passport
        ) public {
            address user_address = 0x069531386d1B08423fDBB45d167356A8Ea7410f2;
            RequestDocumentsMap[user_address] = RequestDocuments( requestedBy, aadhar, dl, passport);
    }

    function sendApproved(
        address user_address,
        string memory requestedBy,
        string memory aadhar,
        string memory dl,
        string memory passport
        ) public {
            RequestDocumentsMap[user_address] = RequestDocuments( requestedBy,aadhar, dl, passport);
    }

    function sendRejected(
        address user_address,
        string memory requestedBy,
        string memory aadhar,
        string memory dl,
        string memory passport
        ) public {
            RequestDocumentsMap[user_address] = RequestDocuments( requestedBy,aadhar, dl, passport);
    }

    function viewRequest(address user_address) public view
        returns (
            string memory requestedBy,
            string memory aadhar,
            string memory dl,
            string memory passport
            ) {
            RequestDocuments storage ThisDocuments = RequestDocumentsMap[user_address];
            return ( 
                ThisDocuments.requestedBy,
                ThisDocuments.aadhar,
                ThisDocuments.dl,
                ThisDocuments.passport );
    }


}
